const CreateUserOptions = () => {
  return (
    <div className='create-options-page'>
        <div className="create-options-left"></div>
        <div className="create-options-right">
          <img src="./../../../img/3dperson5.png" alt="" />
        </div>
    </div>
  )
}

export default CreateUserOptions
